import React from 'react';
import ExperienceItem from '../components/ExperienceItem'; // Adjust the path as needed

const Experience = () => {
  // Sample experience data (replace with your actual data)
  const experiences =  [
    {
      company: 'Eagleview',
      website: 'https://www.eagleview.com/',
      text: 'It all started with Neopets avatars. Who knew customizing pixelated pets would ignite a passion for code? A B.S. in Software Engineering and a minor in Digital Technology fueled my desire to explore the design side of coding. My internship journey began at Eagleview, where I built a health check monitor for microservices, ensuring their systems ran smoothly.',
    },
    {
      company: 'Liberty Mutual',
      website: 'https://www.libertymutual.com/',
      text: 'Next, at Liberty Mutual, I bridged the gap between code and design by crafting a landing page and icons for their Mainframe team. This experience solidified my love for user-centered design.',
    },
    {
      company: 'Chase Cost Management',
      website: 'https://www.chasecostmanagement.com/',
      text: 'Chase Cost Management saw me tackle user interfaces and build a client portal. Witnessing users visualize their savings data through my creation was incredibly rewarding.',
    },
    {
      company: 'Poatek IT Consulting',
      website: 'https://www.poatek.com/',
      text: 'Poatek IT Consulting honed my skills in automating project tracking with APIs. Streamlining processes with code became a specialty.',
    },
    {
      company: 'Inward',
      website: 'https://www.inwardhq.com/',
      text: 'Finally, at Inward, I streamlined data analysis, ensuring valuable insights were readily available. This experience solidified the importance of data-driven decision making.',
    },
  ];

  return (
    <div className="experience-page">
      <h2>EXPERIENCE</h2>
      {experiences.map((experience) => (
        <ExperienceItem key={experience.company} {...experience} />
      ))}
    </div>
  );
};

export default Experience;
